def play_music_sheet(interval, music_sheet):
    """
    模拟按键以播放乐曲谱。

    参数:
    interval (float): 按键之间的间隔时间（秒）。
    music_sheet (list): 包含按键组合的乐曲谱数组。
    """
    for combo in music_sheet:
        keyboard.press_and_release(combo)  # 模拟按下键盘
        time.sleep(interval)  # 设置按键间隔时间

